INSERT INTO `board` VALUES (42,'2024-05-14 16:27:07.805387','2024-05-14 16:27:40.569665','<p>안녕하세요! 저는 XASDW팀 기획자입니다 ☺</p><p>현재 기획과 디자인 단계 마무리하고, 개발 단계입니다. 저희 XASDW팀과 함께하실 <strong>Flutter </strong>개발자님을 찾고 있습니다 ✨</p><p>​</p><p>? XASDW앱소개</p><p>XASDW는 다양한 필요에 맞춰 맞춤형으로 제공되는 서비스를 통해 더 나은 삶을 돕고자 합니다.&nbsp;</p><p>​</p><p>? 모집 포지션</p><p>앱 개발 - 프론트엔드(1명)</p><p>​</p><p>? 기술 스택</p><p>Flutter</p><p>​</p><p>? 현재 팀원 구성</p><p>기획자 2명, 디자이너 2명, 백엔드 1명, 프론트엔드 1명</p><p>&nbsp;</p><p>☎️ 연락</p><p>Lorem Ipsum&nbsp;is simply dummy</p><p>* 프로젝트에 대해 궁금한 것이 있다면 편하게 연락주세요!</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"Flutter\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}]','[사이드 프로젝트 - 프론트엔드] 같이 팀 프로젝트 진행하실 flutter 개발자님 찾습니다! ?',1,NULL,1,1,69569809,17,401,1,0,NULL),(49,'2024-05-18 00:05:47.233263','2024-05-18 00:21:23.298864','<p>안녕하세요! OpenAI에서 SSAFY 부울경 3팀에게 협업을 요청합니다.?</p><p>저희 팀은 현재 기획과 디자인 단계를 마치고, 개발 단계로 넘어가고 있습니다. 함께할 React 프론트엔드 개발자님을 모시고자 합니다! ?</p><p>? <strong>XASDW 앱 소개</strong></p><p>XASDW는 다양한 요구에 맞춘 맞춤형 서비스를 제공하여 더 나은 삶을 지원하는 앱입니다.</p><p>?‍? <strong>모집 포지션</strong></p><p>프론트엔드 개발자 - 2명<br>백엔드 개발자 - 1명</p><p>?️ <strong>기술 스택</strong></p><p>React</p><p>Redux</p><p>Firebase</p><p>Code-Server</p><p>SonarQube</p><p>PortOne</p><p>Neo4j</p><p>Redis</p><p>&nbsp;</p><p>? <strong>현재 팀 구성</strong></p><ul><li>기획자 2명</li><li>디자이너 2명</li><li>백엔드 개발자 1명</li></ul><p>? <strong>연락처</strong></p><p>문의는 디엠 부탁드릴게요 ?</p><p>? 프로젝트에 대해 궁금한 점이 있으시면 언제든지 편하게 연락주세요!</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"NLP\"}, {\"subCategoryName\": \"AI\"}, {\"subCategoryName\": \"BACKEND\"}, {\"subCategoryName\": \"FRONTEND\"}, {\"subCategoryName\": \"SINABRO\"}, {\"subCategoryName\": \"AWESOME\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}]','OpenAI에서 ChatGPT 개발 하실 개발자 구합니다.',1,NULL,1,2,94429120,39,401,0,0,NULL),(50,'2024-05-18 00:12:04.438864','2024-05-18 00:12:04.438864','<p>특정 부분에서 쿼리가 너무 많이 나가고 있어서 성능 개선이 필요할거 같은데 어느 부분을 고쳐야할지 모르겠습니다</p><p>&nbsp;</p><p>Example.java 파일에서 example 메소드의 코드 리뷰 부탁드립니다&nbsp;</p><p>&nbsp;</p><p>코드 리뷰 해주시면 기프티콘 드릴게요</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"GGA:ME\"}, {\"subCategoryName\": \"성능개선\"}, {\"subCategoryName\": \"\"}]','역대 최고의 게임 추천 사이트 GGA:ME 에서 코드 리뷰 부탁드립니다.',1,NULL,1,1,94429120,40,403,0,0,NULL),(51,'2024-05-18 00:14:29.918241','2024-05-18 00:19:20.510935','<p>초보 개발자를 위한 팀 프로젝트를 하고싶습니다.&nbsp;<br>적합한 팀 프로젝트를 준비중이신 개발자분들 연락주세요</p><p>&nbsp;</p><p>보유 기술 스택</p><ul><li>스프링 부트</li><li>레디스</li><li>Neo4j</li><li>OAuth</li><li>Spring Security</li><li>JWT</li></ul><p>&nbsp;</p><p>편하게 채팅 및 댓글 부탁드립니다.</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"스프링부트\"}, {\"subCategoryName\": \"Neo4j\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"OAuth\"}, {\"subCategoryName\": \"\"}]','ChatGPT 와 GGA:ME에서 백엔드를 맡은 신입 개발자입니다. ',1,NULL,0,0,94429120,1,402,0,0,NULL),(52,'2024-05-18 00:26:21.666048','2024-05-18 00:26:21.666048','<p><br>안녕하세요! 게임 추천 사이트 개발사 짜르륵입니다.</p><p>저희 팀은 GGA:ME 라는 게임 추천 사이트의 기획과 디자인 단계를 마치고, 개발 단계로 넘어가고 있습니다. 함께할 데이터 분석가님을 모시고자 합니다! ?</p><p>? <strong>GGA:ME 플랫폼 소개</strong></p><p>GGA:ME는 다양한 요구에 맞춘 맞춤형 게임 추천 서비스를 제공하여 더 나은 게이밍 경험을 지원하는 플랫폼입니다.</p><p>? <strong>모집 포지션</strong></p><p>데이터 분석가 - 2명</p><p>?️ <strong>기술 스택</strong></p><ul><li>Python</li><li>R</li><li>SQL</li><li>TensorFlow</li><li>Apache Spark</li><li>Tableau</li><li>Elasticsearch</li></ul><p>? <strong>현재 팀 구성</strong></p><ul><li>기획자 2명</li><li>디자이너 2명</li><li>백엔드 개발자 1명</li><li>프론트엔드 개발자 2명</li></ul><p>? <strong>연락처</strong></p><p>문의는 디엠 부탁드릴게요 ?</p><p>? 프로젝트에 대해 궁금한 점이 있으시면 언제든지 편하게 연락주세요!</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"\"}]','짜르륵과 함께할 데이터 분석가 모십니다.',1,NULL,1,0,94429120,40,401,0,0,NULL),(53,'2024-05-18 00:27:53.687115','2024-05-18 00:27:53.687115','<p>프론트엔드와 협업하는 간단한 CRUD 토이 프로젝트 팀 구합니다.</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"\"}]','스프링 개발 경력 3개월 토이 프로젝트 구합니다',1,NULL,0,0,94429120,1,402,0,0,NULL),(54,'2024-05-18 00:29:15.757994','2024-05-18 00:38:59.161557','<p>저희 AI 사용해보시고 개선점과 다양한 피드백 부탁드립니다.</p><p>&nbsp;</p><p><a href=\"  https://chatgpt.com/\">https://chatgpt.com/</a></p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}]','ChatGPT-4o 모델을 새롭게 개발했습니다.',1,NULL,0,0,94429120,39,403,0,0,NULL),(55,'2024-05-18 14:55:26.157168','2024-05-18 14:55:26.157168','<p>저희 팀은 현재 기획과 디자인 단계를 마치고, 개발 단계로 넘어가고 있습니다. 함께할 모바일 개발자님을 모시고자 합니다! ?</p><p>? <strong>카카오톡 개발 소개</strong></p><p>카카오톡은 다양한 요구에 맞춘 맞춤형 메신저 서비스를 제공하여 더 나은 소통 경험을 지원하는 앱입니다.</p><p>?‍? <strong>모집 포지션</strong></p><p>모바일 개발자 - 2명</p><p>?️ <strong>기술 스택</strong></p><ul><li>Flutter</li><li>Dart</li><li>Swift</li><li>Kotlin</li><li>Firebase</li><li>RESTful API</li></ul><p>? <strong>현재 팀 구성</strong></p><ul><li>기획자 2명</li><li>디자이너 2명</li><li>백엔드 개발자 1명</li><li>프론트엔드 개발자 1명</li></ul><p>? <strong>연락처</strong></p><p>문의는 디엠 부탁드릴게요 ?</p><p>? 프로젝트에 대해 궁금한 점이 있으시면 언제든지 편하게 연락주세요!</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"카카오톡\"}, {\"subCategoryName\": \"채팅\"}, {\"subCategoryName\": \"swift\"}, {\"subCategoryName\": \"flutter\"}, {\"subCategoryName\": \"\"}]','카카오톡에서 함께할 모바일 개발자 모십니다.',1,NULL,0,2,94429120,45,401,0,0,NULL),(56,'2024-05-18 22:40:55.734329','2024-05-19 23:17:04.609923','<p>안녕하세요 신입 개발자의 꿈을 꾸고 있는 코린이입니다.</p><p>기능 구현은 어째저째 하고 있는데 성능적인 부분이 아쉬운거 같은데 어떻게 하면 좋을지 통 모르겠네요..!</p><p>혹시 제 코드 보시고 개선할만한 부분 있으면 피드백 주시면 감사하겠습니다!!</p>','https://firebase.com/v4/jbbbejqhuabsaskdb.jpg','[{\"subCategoryName\": \"백엔드\"}, {\"subCategoryName\": \"성능이슈\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}, {\"subCategoryName\": \"\"}]','선배님들 코린이 한 번만 도와주십쇼!',1,NULL,0,0,80227755,52,403,0,0,NUL