INSERT INTO `project` VALUES (1,'2024-05-09 11:53:44.892933','2024-05-19 17:25:43.431718','2024-05-19 17:25:43.430396',20000,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/7lans.png?alt=media&token=9b64ec00-1cf0-4b03-8f19-46b89809fae3','지역 아동센터에 봉사활동을 갔다가 들었던 말\n\n\"어차피 다시는 안 올거잖아요.\"\n\n봉사자들의 지속적이지 않은 활동으로 단절감을 느끼고 쉽게 마음을 열지 못하는 아이들을 위해, 지속적인 봉사를 하고싶은 봉사자들을 위해, 그 둘의 거리를 줄여주는 서비스 7lans입니다\n\n주요 사용자\n아동 센터의 초등학교 1~3학년 아동\n아동에게 다가가고 싶지만 물리적 거리로 인해 자주 방문하기 힘든 봉사자\n아동들이 다양하고 유대감이 있는 봉사자들을 만나게 해주고 싶은 아동 센터 담당자\n주요 기능\n놀이 및 교육 콘텐츠와 함께하는 화상 서비스 ?\n아동과 봉사자가 서로에게 쪽지를 쓰는 속닥속닥 ?\n지속적인 관계를 이어가고 유대감을 쌓을 수 있는 알 키우기와 공룡도감 ?\n봉사 시간과 활동 일지를 간편하게 온라인으로 조회 및 관리 가능 ?','7lans','https://github.com/JH201421228/aaa.git',503),(2,'2024-05-09 13:46:37.130005','2024-05-18 20:01:47.347616',NULL,20000,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/gol.png?alt=media&token=0d24a64a-c51e-4fd7-9a56-23e743f65687','test2','골라쥬','https://github.com/JH201421228/Algo_Study.git',502),(4,'2024-05-09 16:05:44.745102','2024-05-09 16:05:44.745102','2024-05-09 11:53:44.892933',20000,'/images/E103_Logo.png','\"시장알리미\" 프로젝트는 시장 데이터를 실시간으로 모니터링하고 사용자에게 알림을 제공하는 시스템입니다. 이 프로젝트는 주식, 암호화폐, 상품 등 다양한 시장의 데이터를 수집하고 분석하여, 사용자에게 중요한 변동 사항을 즉시 알릴 수 있습니다','시장알리미','https://github.com/JH201421228/last_test.git',502),(5,'2024-05-09 16:13:35.534885','2024-05-09 16:13:35.534885','2024-05-09 11:53:44.892933',20000,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/MANsMAN.png?alt=media&token=982f32da-2d26-4ff6-a20d-780944aa9532','남자를 위한 앱!<br>평상시에 꾸미고 다니고 싶으신가요?<br>멋있어 지고 싶으신가요?<br>저희 맨스맨은 다 해드립니다~~!','맨s맨','https://github.com/JH201421228/TIL.git',502),(6,'2024-05-09 17:08:54.641140','2024-05-09 17:08:54.641140','2024-05-09 15:51:08.556359',20000,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/personalColor.jpg?alt=media&token=8e730167-28d0-48e9-9018-b081feb4b2a6','\"퍼스널컬러 진단 AI\" 프로젝트는 인공지능을 활용하여 사용자의 퍼스널 컬러를 진단해주는 시스템입니다. 퍼스널 컬러는 개인의 피부톤, 머리색, 눈동자 색 등에 따라 가장 잘 어울리는 색상을 결정하는 방법으로, 패션, 뷰티, 마케팅 등 다양한 분야에서 활용됩니다. 이 프로젝트는 사용자의 사진을 분석하여 퍼스널 컬러를 진단하고, 개인 맞춤형 색상 추천을 제공하는 것을 목표로 합니다','퍼컬프','https://github.com/JH201421228/aaa.git',502),(7,'2024-05-09 17:18:28.700009','2024-05-17 15:49:20.448516',NULL,20000,'/images/E103_Logo.png','tt','DongHang','https://github.com/ymkim0216/gamme.git',502),(8,'2024-05-09 17:39:18.650579','2024-05-09 17:39:18.650579','2024-05-09 11:53:44.892933',20000,'/images/E103_Logo.png','함께 여서 즐거운 우리<br>합동 프로젝트로 여러분을 초대합니다.<br>저희 합동은 협업심을 기르기 위한 서비스로서<br>다양한 사람들과의 커뮤니케이션을 만들어 줍니다.','합동','https://github.com/JH201421228/Algo_Study.git',502),(16,'2024-05-14 14:35:48.401828','2024-05-14 14:35:48.401828',NULL,20005,'/images/pjt_real.png','chat test','test','https://github.com/JeonEunHui/personal_color_1.git',502),(17,'2024-05-14 15:56:07.333284','2024-05-14 15:56:07.333284',NULL,20005,'/images/pjt_real.png','간단한 설명 글입니다.','XASDW','https://github.com/YoungEun-Choi930/ddd-start2.git',502),(23,'2024-05-16 15:03:41.932491','2024-05-16 15:03:41.932491',NULL,20009,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/umzipLogo.png?alt=media&token=000c866b-9a42-41fd-9c77-413326691a7c','1234','움집','https://github.com/ymkim0216/gamme.git',502),(39,'2024-05-17 23:59:48.816284','2024-05-17 23:59:48.816284',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/ChatGPT-Logo.png?alt=media&token=a0a44237-d1b0-4fcd-a19e-5e5d03b532cc','안녕하세요 OpenAI 입니다. ChatGPT 도 시나브로에서 만들었습니다.<br>시나브로 짱입니다. 최고 최고 극찬의 극찬','ChatGPT','https://github.com/JongKookE/GGAME.git',502),(40,'2024-05-18 00:09:19.212463','2024-05-18 00:09:19.212463',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/GGAME-Logo.png?alt=media&token=002b9f52-17b0-47a1-bc61-e629ed81e064','정확한 게임 추천 알고리즘!<br>당신의 취향 저격!<br>한눈에 들어오는 UI<br>최신 게임 구비 완료!<br>사용자의 리뷰 완벽 분석!','GGA:ME','https://github.com/JongKookE/GGAME.git',502),(41,'2024-05-18 14:42:23.982451','2024-05-18 14:42:23.982451',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/%EA%B5%90%EC%9C%A1_%EC%95%84%EC%9D%B4%EC%BD%98_%ED%98%B8%EC%A3%BC_%EC%98%A4%ED%8E%98%EB%9D%BC%ED%95%98%EC%9A%B0%EC%8A%A4_001.jpg?alt=media&token=7236a584-f350-40bf-b62d-cd9b041f20fe','간편하게 뉴스를 요약하여 읽어주는 어플 프로젝트','미뉴에트','https://github.com/silverhappy98/test_sinabro.git',502),(44,'2024-05-18 14:50:48.534384','2024-05-18 14:50:48.534384',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/1716130491477.webp?alt=media&token=658cc4ab-e31b-4943-9de6-b4b7e60ee130','? StudyProjec ?<br>StudyProject는 학생들과 전문가들이 함께 학습하고 성장할 수 있는 온라인 플랫폼입니다.<br>주요 기능<br>1. 학습 자료 공유 ? - 강의 노트, 프레젠테이션, 논문 등 다양한 학습 자료를 업로드하고 공유할 수 있습니다.<br>2. 프로젝트 협업 ? - 공동 프로젝트를 생성하고 팀원들과 협력하여 진행 상황을 관리할 수 있습니다.<br>3. 토론 게시판 ? - 학습 주제에 대해 자유롭게 토론하고 의견을 나눌 수 있는 게시판을 제공합니다.<br>4. 온라인 강의 ? - 다양한 주제의 온라인 강의를 시청하고, 실시간으로 질문을 할 수 있습니다.<br>회원 혜택<br>- 무료 회원 ?<br>- 프리미엄 회원 ?','StudyProject','https://github.com/Seungjun-Song/sinabro.git',502),(45,'2024-05-18 14:53:06.085910','2024-05-18 14:53:06.085910',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/kakaoTalk-Logo.png?alt=media&token=0344d4e1-7fc4-4481-bb89-cdab651aa02e','카카오톡은 대한민국에서 가장 인기 있는 모바일 메신저 앱입니다. 2010년에 출시된 이후, 사용자 간의 실시간 메시지 전송, 사진 및 동영상 공유, 음성 및 영상 통화 등 다양한 기능을 제공하며 빠르게 성장했습니다.<br><br>카카오톡은 단순한 메신저 기능 외에도 친구 찾기, 채팅방 초대, 카카오프렌즈 이모티콘 등 사용자 경험을 높이는 다양한 부가 기능을 지원합니다. 또한, 카카오톡 플랫폼은 게임, 쇼핑, 금융 서비스 등과 연동되어 다채로운 디지털 라이프스타일을 제공합니다.<br><br>카카오톡은 현재 전 세계 수백만 명의 사용자들에게 사랑받고 있으며, 지속적으로 새로운 기능을 추가하며 발전하고 있습니다.','깨깨오톡','https://github.com/JongKookE/GGAME.git',502),(48,'2024-05-18 16:41:52.351418','2024-05-18 16:41:52.351418',NULL,20010,'/images/E103_Logo.png','asdfasdf','안녕하세요','https://github.com/cho1jaeseong/newwe.git',502),(49,'2024-05-18 16:52:16.342889','2024-05-18 16:52:16.342889',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/sinabro_logo.png?alt=media&token=f93cdef7-c469-46e1-9a34-300195983079','프로젝트를 조금 더 쉽게 시작할 수 있게 해주는 프로젝트','시나브로','https://github.com/silverhappy98/sinabro.git',502),(51,'2024-05-19 01:18:21.031315','2024-05-19 01:18:43.760104','2024-05-19 01:18:43.758121',20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/Youtube-Logo.png?alt=media&token=ec08619d-3bbb-4865-a905-e49ee5382939','인터넷을 통해 영상을 시청하고 업로드할 수 있는 서비스입니다. 사용자들은 다양한 주제의 동영상을 검색하고 시청할 수 있으며, 자신의 콘텐츠를 업로드하여 공유할 수도 있습니다. 유튜브는 사용자들에게 광고 수익을 제공하고, 구독자들과의 상호작용을 통해 커뮤니티를 형성하고 있습니다. 또한 유튜브는 다양한 기기에서 접근 가능하며, 모바일 앱 및 웹 브라우저를 통해 언제 어디서나 동영상을 시청할 수 있습니다.','유튜브','https://github.com/JongKookE/GGAME.git',503),(52,'2024-05-19 15:25:26.366684','2024-05-19 15:25:26.366684',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/HomeCafe.webp?alt=media&token=5800a336-8e87-418a-b94f-7e77303c9e08','집에서도 간단하게 카페를 즐기고 싶다면?<br>집에서 손님과 함께 분위기를 내고 싶다면?<br>홈 카페 프로젝트를 함께 만들어 봐요!','HomeCafe','https://github.com/Seungjun-Song/sinabro.git',502),(53,'2024-05-19 15:38:09.994078','2024-05-19 15:38:09.994078',NULL,20010,'https://firebasestorage.googleapis.com/v0/b/last-pjt.appspot.com/o/Never.webp?alt=media&token=9d7acc76-d7d5-473e-85b2-f8f613f62de4','안녕하세요 프로젝트 Never입니다.<br>저희 프로젝트 Never는 ‘절대’ 혼자서는 모든 것을 할 수 없다는 의미인데요!<br>그렇기에 다양한 사람들과 함께 하는 서비스를 제공해주는 웹 프로젝트입니다.','Never','https://github.com/Seungjun-Song/sinabro.git',502);
